INSERT INTO `qlbl_selfdb_comment` VALUES ('1', null, '2017-09-20 05:11:25', null, '各方面都完美 都没想到那么贴心 细心 非常感谢', '156****7911');
INSERT INTO `qlbl_selfdb_comment` VALUES ('2', null, '2017-09-12 19:30:34', null, '态度很好，衣服有一个地方没办法洗干净，还特意写了张纸条说明下', '137****3413');
INSERT INTO `qlbl_selfdb_comment` VALUES ('3', null, '2017-09-12 01:14:58', null, '超赞啊！本来这衣服打算不要了，太脏，但是洗完又像新的一样了，尤其是领子的地方，太干净了', '183****3570');
INSERT INTO `qlbl_selfdb_comment` VALUES ('4', null, '2017-09-11 15:58:37', null, '太赞了，把我的西装洗的跟新的一样，还包装的特别号，服务态度还超好。这么用心的企业一定能经营100年', '155****5714');
INSERT INTO `qlbl_selfdb_comment` VALUES ('5', null, '2017-09-16 02:48:19', null, '超赞的，从取件到清洗都有相关人员随时沟通，总是特别好，可信赖', '180****2587');
INSERT INTO `qlbl_selfdb_comment` VALUES ('6', null, '2017-09-16 06:46:47', null, '总体来说服务不错，取件师傅准时接送件，赶飞机比较急的情况下，不到5小时就送到了', '135****1786');
INSERT INTO `qlbl_selfdb_comment` VALUES ('7', null, '2017-09-27 10:55:57', null, '特别干净特别特别特别干净，也很快就送回来了！很好，五星好评', '183****1993');
INSERT INTO `qlbl_selfdb_comment` VALUES ('8', null, '2017-09-20 14:42:12', null, '感觉还不错，上门取货上门送货，很方便，也比外面洗要便宜', '137****3783');
INSERT INTO `qlbl_selfdb_comment` VALUES ('9', null, '2017-09-16 18:07:43', null, '朋友推荐，第一次选择宿洗，服务特别好，关键是快，专业，而且大品牌好衣服也洗也很放心', '145****3138');
INSERT INTO `qlbl_selfdb_comment` VALUES ('10', null, '2017-09-22 01:02:33', null, '送货的陈小哥服务态度非常热情有礼，微笑服务，辛苦了！', '159****2252');
INSERT INTO `qlbl_selfdb_comment` VALUES ('11', null, '2017-09-14 05:26:02', null, '洗了两条条裤子，装修沾了好多难洗的墙体大白 睡一觉起来就洗好了，回来干干净净，平平整整，高兴', '151****3051');
INSERT INTO `qlbl_selfdb_comment` VALUES ('12', null, '2017-09-14 13:35:59', null, '洗衣服的小哥服务好，送货快，衣服洗的该不错，已经是宿洗的老客户了', '135****9348');
INSERT INTO `qlbl_selfdb_comment` VALUES ('13', null, '2017-09-26 11:23:51', null, '这次对接的刘姐很好，解答耐心细致，衣服洗的干干净净，洗衣速度快，很满意！高端系很放心', '130****3081');
INSERT INTO `qlbl_selfdb_comment` VALUES ('14', null, '2017-09-16 12:36:07', null, '收件速度超赞，晚上10点下的单，第二天早上8点半的飞机，7点就送过来，辛苦收件小哥了！下次还用宿洗，赞一个', '187****6973');
INSERT INTO `qlbl_selfdb_comment` VALUES ('15', null, '2017-09-12 16:01:31', null, '包装到位，洗的也不错，主要是时间短，很适合我这种经常出差又很少带换洗衣服的人，睡一觉起来衣服就洗完了', '137****8902');
INSERT INTO `qlbl_selfdb_comment` VALUES ('16', null, '2017-09-18 18:53:10', null, '服务人员态度很好，这次是洗西装，洗的很干净，赞！', '145****7282');
INSERT INTO `qlbl_selfdb_comment` VALUES ('17', null, '2017-09-14 12:53:59', null, '洗的很干净  仔细！ 白裤子上实在洗不掉的污渍还特意留言做了说明', '188****4577');
INSERT INTO `qlbl_selfdb_comment` VALUES ('18', null, '2017-09-20 19:41:46', null, '哇塞，来拿衣服的小哥态度也太好了吧，冲他服务这么亲切都要给100哥赞~第一次试试，拿了件很脏的外套洗，然后收到短信提醒衣服有难除的污渍和泼酸，会选合适方式洗，很贴心的服务，其实最后衣服洗的挺好，考虑下次拿毛衣来洗', '189****9465');
