INSERT INTO `qlbl_selfdb_comment` VALUES ('20', null, '2017-09-15 11:49:02', null, '一如既往的好啊！小哥工作超级认真负责，建议贵司给此类员工多鼓励鼓励，比如涨薪，多发奖金等！！贵司才能业绩长虹！', '155****8390');
