INSERT INTO `qlbl_selfdb_comment` VALUES ('107', null, '2017-09-26 02:36:43', null, '服务很好，衣服洗的也好，拿回来还用衣架挂的很整齐很板正', '152****6005');
INSERT INTO `qlbl_selfdb_comment` VALUES ('108', null, '2017-09-19 11:27:17', null, '不得不评论一个超级赞！口红不小心方口袋忘记拿出来了，在洗衣机裙子全农商口红！我都已经做好洗不干净的准备了！没想到洗的干干净净！真赞', '133****5955');
INSERT INTO `qlbl_selfdb_comment` VALUES ('109', null, '2017-09-12 06:20:40', null, '服务态度很好，洗送及时，下单取送货很快，很适合商务办公时间比较紧张的人群', '131****9547');
INSERT INTO `qlbl_selfdb_comment` VALUES ('110', null, '0000-00-00 00:00:00', null, '上门取衣的美女特别亲切，服务细致入微，超放心，衣服送回来也是及时和我联络在合适我的时间送回，真心方便极了，衣服洗的也棒棒的，为我们出门的提供的实实在在的便利！赞一个！', '138****4930');
INSERT INTO `qlbl_selfdb_comment` VALUES ('111', null, '0000-00-00 00:00:00', null, '这次服务非常满意，把我之前一年泛黄的衬衫都洗白了，很满意，自己洗的绝对达不到这个效果', '132****5914');
INSERT INTO `qlbl_selfdb_comment` VALUES ('112', null, '2017-09-23 11:18:48', null, '衣服洗的很快，很好，送衣的小哥态度很好，多次联系，非常感谢！', '156****2268');
INSERT INTO `qlbl_selfdb_comment` VALUES ('113', null, '2017-09-10 14:54:37', null, '取送员服务超级好，送取件都会提前联系，及时送取件，清洗特别专业，以后还会继续下单', '138****5101');
INSERT INTO `qlbl_selfdb_comment` VALUES ('114', null, '2017-09-13 04:38:17', null, '收货送货都很快！不过有意见衣服的菱角处没有完全烫平', '151****5802');
INSERT INTO `qlbl_selfdb_comment` VALUES ('115', null, '2017-09-23 14:15:54', null, '不错，省了很多力气，不用扛着去洗，再扛回家了', '157****4135');
INSERT INTO `qlbl_selfdb_comment` VALUES ('116', null, '2017-09-22 00:48:59', null, '取送衣服的帅哥颜值高，服务态度好，衣服洗的很干净又高效  很满意', '132****1755');
INSERT INTO `qlbl_selfdb_comment` VALUES ('117', null, '2017-09-26 12:54:47', null, '取送件都很及时，并且全程电话联系。送进厂清洗时，有任何问题都是由专人随时对接的，同意后才进行下一步清洗，很棒', '135****4368');
INSERT INTO `qlbl_selfdb_comment` VALUES ('118', null, '2017-09-15 09:03:32', null, '服务态度很好，取送件及时，宿洗很方便，谢谢提供这个平台', '189****6606');
INSERT INTO `qlbl_selfdb_comment` VALUES ('119', null, '2017-09-14 11:51:40', null, '来取件的小伙子特别负责，来前还提前电话沟通 ，特别有礼貌。准时到达，很认真帮着检车衣服哪里脏。还介绍怎么使用优惠券，服务周到。第二天就洗好送回了。简直是神速啊！本来没想到能洗掉的机油也洗的差不多了！', '187****2829');
INSERT INTO `qlbl_selfdb_comment` VALUES ('120', null, '2017-09-20 06:11:06', null, '服务态度好，效率高，衣服洗的比一般小店铺洗的干净很多', '134****6577');
INSERT INTO `qlbl_selfdb_comment` VALUES ('121', null, '2017-09-11 04:37:27', null, '态度挺好的，下大雨还给送过来，家里没人，冒雨在外面等了20多分钟，挺感动的！', '188****9511');
INSERT INTO `qlbl_selfdb_comment` VALUES ('122', null, '2017-09-20 23:30:20', null, '真的只有那么贴心了，小哥收发货也非常速度，衣服洗的干净整洁，真的太棒了，辛苦啦！', '158****9503');
INSERT INTO `qlbl_selfdb_comment` VALUES ('123', null, '2017-09-13 19:16:33', null, '一如既往的好，不知道其他地区什么时候可以在服务范围内', '182****4156');
INSERT INTO `qlbl_selfdb_comment` VALUES ('124', null, '2017-09-22 12:45:24', null, '衣服洗的很干净，包装很用心，上门取送件的小哥服务态度超赞，能预约上门方便多了', '145****1608');
INSERT INTO `qlbl_selfdb_comment` VALUES ('125', null, '2017-09-24 22:18:53', null, '真的第一次用，赞赞赞，原本以为洗不掉的都洗掉了，好评，而且取件的人员特别耐心', '134****5402');
INSERT INTO `qlbl_selfdb_comment` VALUES ('126', null, '2017-09-12 05:12:57', null, '一如既往的快捷，洗的干净整洁，熨烫的挺括有型，谢谢贵平台贴心周到的服务。', '133****8011');
INSERT INTO `qlbl_selfdb_comment` VALUES ('127', null, '2017-09-23 19:47:49', null, '超级好！服务特别棒！万分感谢上门取货送货的帅哥', '182****1635');
INSERT INTO `qlbl_selfdb_comment` VALUES ('128', null, '2017-09-15 00:41:07', null, '这是洗衣界的顺丰吗？洗的干净不说，上门取送真是方便，还能看到洗衣进展到哪一步', '188****6294');
INSERT INTO `qlbl_selfdb_comment` VALUES ('129', null, '2017-09-15 00:12:16', null, '及时，准确，系统实时更新状态，取件师傅辛苦了！已经用了很多次', '188****2847');
INSERT INTO `qlbl_selfdb_comment` VALUES ('130', null, '2017-09-14 07:27:36', null, '洗衣速度很快，洗的还算干净，虽然还是有一点点印记，不仔细看是看不出来的 让我自己洗肯定洗不掉', '157****4291');
INSERT INTO `qlbl_selfdb_comment` VALUES ('131', null, '2017-09-13 17:37:41', null, '非常有礼貌的服务员 另外每一次都用心去做，值得表扬', '132****6068');
INSERT INTO `qlbl_selfdb_comment` VALUES ('132', null, '2017-09-20 23:16:32', null, '师傅取件送件都很给力，给师傅一个大大的赞', '157****5511');
INSERT INTO `qlbl_selfdb_comment` VALUES ('133', null, '2017-09-24 15:33:56', null, '经常用宿洗，洗的干净。服务又好，时间还能自己控制', '188****4005');
INSERT INTO `qlbl_selfdb_comment` VALUES ('134', null, '2017-09-14 11:27:34', null, '挺好的，洗了两次了。。。。。。方便，送洗都比较快', '135****9146');
INSERT INTO `qlbl_selfdb_comment` VALUES ('135', null, '2017-09-24 20:02:25', null, '以前在汤姆叔叔洗，自动用了宿洗后，一直在用，主要是上门取送太方便了，洗的还干净，赞一个！', '182****2331');
INSERT INTO `qlbl_selfdb_comment` VALUES ('136', null, '2017-09-24 17:46:53', null, '洗的很干净，粉底沾在黑衬衫上很难洗也去除了，赞', '183****1420');
INSERT INTO `qlbl_selfdb_comment` VALUES ('137', null, '2017-09-20 01:38:03', null, '特别好的服务，谢谢取件送件人员的周到服务，以后会一直光顾的', '139****2395');
INSERT INTO `qlbl_selfdb_comment` VALUES ('138', null, '2017-09-15 01:29:05', null, '靠谱的小哥，态度好！有耐心！衣服洗的很干净！以后还要继续用宿洗', '139****7452');
INSERT INTO `qlbl_selfdb_comment` VALUES ('139', null, '2017-09-24 09:19:16', null, '洗裤子干净又快，定下什么时间送就什么时间送到，赞', '134****9870');
INSERT INTO `qlbl_selfdb_comment` VALUES ('140', null, '2017-09-15 10:24:23', null, '好好好！没的说，太棒了，洗衣块，干净，包装整齐，很正规，高大上呢', '139****4824');
INSERT INTO `qlbl_selfdb_comment` VALUES ('141', null, '2017-09-25 12:39:57', null, '速度挺快的，工作人员服务的也是很好，非常方便，在家就有人帮忙洗衣服', '132****8821');
INSERT INTO `qlbl_selfdb_comment` VALUES ('142', null, '2017-09-23 05:48:25', null, '洗过几次衣服，，尤其是大一清洗的效果是最好，个人感受，望有用', '135****1368');
INSERT INTO `qlbl_selfdb_comment` VALUES ('143', null, '2017-09-18 14:40:30', null, '方便！快捷！宿洗，我有我的选择，洗衣服，就上宿洗，妥妥哒！', '188****4918');
INSERT INTO `qlbl_selfdb_comment` VALUES ('144', null, '2017-09-13 09:26:20', null, '取送件的小伙子态度非常好，我加四楼没电梯要走上来，辛苦了！', '155****9240');
INSERT INTO `qlbl_selfdb_comment` VALUES ('145', null, '2017-09-26 07:54:50', null, '不错，非常满意，上门取件，清洗完毕送货上门，洗的很干净，超赞！', '157****8156');
INSERT INTO `qlbl_selfdb_comment` VALUES ('146', null, '2017-09-23 06:38:48', null, '真好，洗的干净，专业，上门取送，时间及时，服务周到！', '186****1700');
INSERT INTO `qlbl_selfdb_comment` VALUES ('147', null, '2017-09-10 18:21:20', null, '第二次用了，非常好，取送都很快，优惠券也很实惠，很开心，比实体店便宜，更快，值得推荐', '158****6921');
INSERT INTO `qlbl_selfdb_comment` VALUES ('148', null, '2017-09-24 20:07:58', null, '衣物干净整洁，最值得表扬的就是业务员，公众服务那种贴心，非常感动，方便快捷，使我们上班族没有了后顾之忧，感谢宿洗', '157****8187');
INSERT INTO `qlbl_selfdb_comment` VALUES ('149', null, '2017-09-10 15:35:57', null, '意想不到的好，以为不能洗干净的都洗得非常干净，很赞', '159****2562');
INSERT INTO `qlbl_selfdb_comment` VALUES ('150', null, '2017-09-19 10:13:29', null, '取件快速，送货及时，洗了四件外套，都很干净平整，满意', '145****1963');
INSERT INTO `qlbl_selfdb_comment` VALUES ('151', null, '2017-09-22 02:38:02', null, '服务态度特别好，洗得很干净，特别好，非常满意，速度哈哈特快！', '156****9396');
INSERT INTO `qlbl_selfdb_comment` VALUES ('152', null, '2017-09-17 00:43:31', null, '洗得又干净又快，速度真的只有5小时,支持', '157****3826');
INSERT INTO `qlbl_selfdb_comment` VALUES ('153', null, '0000-00-00 00:00:00', null, '物流小哥好帅，哈哈哈！', '138****2843');
INSERT INTO `qlbl_selfdb_comment` VALUES ('154', null, '2017-09-18 23:52:43', null, '临时有事，小哥等了好久。不好意思!', '157****4320');
INSERT INTO `qlbl_selfdb_comment` VALUES ('155', null, '2017-09-24 20:44:52', null, '深圳出差，没带衣服，看到酒店的推广，试了下，真心不错，快点覆盖到别的区吧。支持', '133****5861');
INSERT INTO `qlbl_selfdb_comment` VALUES ('156', null, '2017-09-14 05:27:15', null, '陪客户去工厂，客户只带了一套。然后悲了。。。。还好有宿洗', '133****6959');
INSERT INTO `qlbl_selfdb_comment` VALUES ('157', null, '2017-09-15 23:22:54', null, '5小时到达，真没吹牛', '156****2516');
