INSERT INTO `qlbl_selfdb_comment` VALUES ('159', null, '2017-09-20 06:56:03', null, '衣服有个小洞，宿洗还帮我处理了，谢谢!', '135****7121');
INSERT INTO `qlbl_selfdb_comment` VALUES ('160', null, '2017-09-18 15:35:25', null, '很棒的一次体验！', '151****2462');
