INSERT INTO `qlbl_selfdb_comment` VALUES ('162', null, '2017-09-19 03:10:52', null, '很方便，出去玩了，然后回酒店就给我送过来了，好快', '132****6671');
INSERT INTO `qlbl_selfdb_comment` VALUES ('163', null, '2017-09-13 15:28:52', null, '总体还不错。值得体验', '183****6693');
INSERT INTO `qlbl_selfdb_comment` VALUES ('164', null, '2017-09-18 13:21:16', null, '出去玩方便，这样的服务太好了。', '156****9782');
INSERT INTO `qlbl_selfdb_comment` VALUES ('165', null, '0000-00-00 00:00:00', null, '还是大深圳好啊，服务就是不一样，来深圳玩，没带够衣服。玩前下单，回来后就把洗好的衣服给我了。太方便了!', '132****8681');
INSERT INTO `qlbl_selfdb_comment` VALUES ('166', null, '2017-09-14 07:23:16', null, '比酒店里面的强太多了。值得一试', '135****2343');
INSERT INTO `qlbl_selfdb_comment` VALUES ('167', null, '2017-09-10 04:35:32', null, '物流的小哥真心不错，你们辛苦了，这样说老板会给你加工资吗？哈哈!', '182****6737');
INSERT INTO `qlbl_selfdb_comment` VALUES ('168', null, '2017-09-17 05:01:02', null, '辛苦小哥了，跑了几趟！', '188****5151');
