  `notification_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `sender_uid` int(11) DEFAULT '0' COMMENT '发送者ID  0:系统发送',
  `recipient_uid` int(11) DEFAULT '0' COMMENT '接收者ID',
  `action_type` int(4) DEFAULT NULL COMMENT '操作类型',
  `model_type` smallint(11) NOT NULL DEFAULT '0',
  `source_id` varchar(16) NOT NULL DEFAULT '0' COMMENT '关联 ID',
  `add_time` datetime DEFAULT NULL COMMENT '添加时间',
  `read_flag` tinyint(1) DEFAULT '0' COMMENT '阅读状态',
  `recipient_type` tinyint(10) DEFAULT '1' COMMENT '接收者类型，1,客户（用户），2，门店，3，管理员',
  PRIMARY KEY (`notification_id`),
  KEY `recipient_read_flag` (`recipient_uid`,`read_flag`),
  KEY `sender_uid` (`sender_uid`),
  KEY `model_type` (`model_type`),
  KEY `source_id` (`source_id`),
  KEY `action_type` (`action_type`),
  KEY `add_time` (`add_time`)
) ENGINE=MyISAM AUTO_INCREMENT=404 DEFAULT CHARSET=utf8 COMMENT='系统通知';

-- ----------------------------
-- Records of qlbl_notification
-- ----------------------------

-- ----------------------------
-- Table structure for `qlbl_notification_data`
-- ----------------------------
DROP TABLE IF EXISTS `qlbl_notification_data`;
CREATE TABLE `qlbl_notification_data` (
  `notification_id` int(11) unsigned NOT NULL,
  `data` text,
  PRIMARY KEY (`notification_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='系统通知数据表';

-- ----------------------------
-- Records of qlbl_notification_data
-- ----------------------------

-- ----------------------------
-- Table structure for `qlbl_order`
-- ----------------------------
DROP TABLE IF EXISTS `qlbl_order`;
CREATE TABLE `qlbl_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(100) NOT NULL COMMENT '订单号',
  `u_id` int(11) NOT NULL COMMENT '用户id',
  `remarks` varchar(255) NOT NULL DEFAULT '无' COMMENT '用户备注',
  `user_address` varchar(255) NOT NULL COMMENT '用户地址',
  `user_name` varchar(100) NOT NULL COMMENT '用户名称',
  `user_phone` varchar(100) NOT NULL COMMENT '用户电话',
  `good_name` varchar(255) NOT NULL COMMENT '下单商品名称',
  `good_price` varchar(200) NOT NULL COMMENT '商品总价',
  `coupon_id` int(11) NOT NULL COMMENT '优惠券id',
  `coupon_price` varchar(255) NOT NULL COMMENT '优惠券价格',
  `distribution_price` varchar(255) NOT NULL COMMENT '配送价格',
  `distribution_id` int(11) NOT NULL COMMENT '配送id',
  `order_price` varchar(255) NOT NULL COMMENT '实付价格',
  `create_time` int(10) NOT NULL,
  `update_time` int(10) NOT NULL,
  `status` tinyint(2) NOT NULL COMMENT '0下单成功未支付-1下单成功已支付商家未接单-3商家已接单-4商家已通知快递员上门取件-5快递员已取件-6商家收到货品-7商家完成订单-8快递员已取件正在配送-9已经送达-10送达成功-11送达失败-12用户删除订单',
  `admin_remarks` varchar(255) DEFAULT NULL COMMENT '无',
  `take_time` varchar(200) NOT NULL COMMENT '用户定取货时间',
  `give_time` varchar(200) NOT NULL COMMENT '用户定送货时间',
  `good_id` varchar(255) DEFAULT NULL COMMENT '产品id',
  `good_num` varchar(255) DEFAULT NULL COMMENT '产品数量',
  `is_complaint` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否被举报 0未举报 1已举报',
  `business_id` int(11) DEFAULT '0' COMMENT '商家id',
  `msg` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `address_id` int(11) DEFAULT NULL COMMENT '地址id',
  `expres_fee_remark` text COMMENT '运费相关备注',
  `goods_tag` varchar(255) DEFAULT NULL COMMENT '预约下单的各类。',
  `system_remarks` text COMMENT '系统执行时的相关备注信息',
  `out_trade_no` varchar(255) DEFAULT NULL COMMENT '微信支付时使用的支付号，后4位为随机位避免支付时产生的商户订单已存在的错语',
  `invoice_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否开具发票 0未开发票 1已开发票',
  PRIMARY KEY (`id`),
  KEY `order_number` (`order_number`)
) ENGINE=InnoDB AUTO_INCREMENT=2252 DEFAULT CHARSET=utf8 COMMENT='用户订单表存储订单信息';

-- ----------------------------
-- Records of qlbl_order
-- ----------------------------

-- ----------------------------
-- Table structure for `qlbl_order_complaint`
-- ----------------------------
DROP TABLE IF EXISTS `qlbl_order_complaint`;
CREATE TABLE `qlbl_order_complaint` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned NOT NULL COMMENT '投诉类型1为洗衣店2为配送快递',
  `content` varchar(255) NOT NULL COMMENT '投诉内容',
  `uid` int(11) NOT NULL,
  `order_id` varchar(200) NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0用户发起投诉未处理 1商户已经处理投诉 2宿洗客服已经回访完毕',
  `create_timg` tinyint(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COMMENT='用户订单投诉表';

-- ----------------------------
-- Records of qlbl_order_complaint
-- ----------------------------

