  `o_id` int(11) DEFAULT NULL COMMENT '订单id',
  `c_id` int(11) DEFAULT NULL COMMENT '优惠券id',
  `discount` varchar(100) DEFAULT NULL COMMENT '消费金额',
  `c_discount` varchar(100) DEFAULT NULL COMMENT '优惠金额',
  `c_time` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COMMENT='优惠券使用记录';

