  `express_fee` decimal(10,0) DEFAULT NULL COMMENT '运费金额',
  `create_date` datetime DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '0:不可用，1可用',
  PRIMARY KEY (`id`)
