  `money` decimal(10,2) DEFAULT NULL COMMENT '变化金额',
  `hotel_id` int(11) DEFAULT NULL COMMENT '酒店ID',
  `share_proportion` varchar(20) DEFAULT NULL COMMENT '分成比例',
  `math_date` varchar(10) DEFAULT NULL COMMENT 'date(''Ym'')匹配比对数据用',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`)
