  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL COMMENT '订单表主键',
  `create_time` int(10) NOT NULL,
  `remark` text NOT NULL COMMENT '备注留言',
  `uid` int(11) NOT NULL COMMENT '快递员或者商家id /0为用户',
  `type` tinyint(1) NOT NULL COMMENT '1为商家2为快递员3为用户',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0/删除-1正常',
  `order_number` varchar(100) DEFAULT NULL COMMENT '订单号',
  `order_status` varchar(4) DEFAULT NULL,
  `express_id` int(11) DEFAULT NULL COMMENT '指定物流人员的ID',
