  `log` text,
  `uid` int(11) DEFAULT NULL COMMENT '操作人的用户ID',
  `utype` varchar(255) DEFAULT NULL COMMENT '操作人的类型，如user_wx微信用户，user_express物流用户，store_user门店用户',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  CONSTRAINT `qlbl_order_log_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `qlbl_order` (`order_number`)
