  `remarks` varchar(255) NOT NULL COMMENT '用户留言',
  `order_time` int(10) NOT NULL COMMENT '订单时间',
  `level_express` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0代表没有 1代表一颗星 配送速度',
